import React from 'react';
import logo from "../icon-left-font.png"
const Header = () => { 
    return(

    <div class="header">
    <a href="#default" class="logo"><img className="logo" src={logo} /></a>
    <div class="header-right">
      <a class="active" href="/">Home</a>
     <li><a>profil</a></li>
     {localStorage.getItem("ROLE") ==="admin" &&<a href='/users'>admin</a>}
     <a>{localStorage.getItem("NAME")} {localStorage.getItem("LASTNAME")}</a>
      <a><button onClick={() => {
        localStorage.clear()
        window.location.replace("/")
    }}>deconnexion</button></a>
    </div>
  </div>)
}

export default Header
